import React from 'react';
import { motion } from 'framer-motion';

const Experience = () => {
  const experiences = [
    {
      title: "Data Science Intern",
      company: "FPT Information System (FPT IS)",
      period: "Apr 2025 - Sep 2025",
      description: [
        "Designed and implemented a data pipeline automating monthly Excel ingestion into SQL Server",
        "Developed Python scripts for consolidation, validation, structured uploads with test/full modes",
        "Integrated SSAS Tabular models and created Power BI dashboards for business insights",
        "Delivered reproducible workflow with operational checklist for monthly refresh",
        "Technologies: Python (pandas, sqlalchemy, pyodbc), SQL Server, SSAS, Power BI"
      ]
    },
    {
      title: "Bachelor of Science in Computer Science",
      company: "Ton Duc Thang University",
      period: "2022 - Present",
      description: [
        "Specializing in Data Science with focus on machine learning and AI applications",
        "Relevant coursework: Algorithms, Data Structures, Machine Learning, Statistics",
        "Active participation in coding competitions and hackathons"
      ]
    },
    {
      title: "Volunteer Teacher",
      company: "Hochiminh Youth Union",
      period: "Summer",
      description: [
        "Taught English to local students and mentored them in their studies",
        "Participated in community activities and educational outreach programs",
        "Developed communication and leadership skills through volunteer work"
      ]
    },
    {
      title: "Graphic Designer Volunteer",
      company: "Hypen Non-Profit Organization",
      period: "Ongoing",
      description: [
        "Designed educational graphics and visual content",
        "Supported the organization's mission of providing equal education opportunities",
        "Collaborated with team members on creative projects"
      ]
    }
  ];

  return (
    <motion.div
      className="page-container"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
    >
      <h1 className="page-title">Experience & Education</h1>

      <div className="timeline">
        {experiences.map((exp, index) => (
          <motion.div
            key={index}
            className="timeline-item"
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: index * 0.2, duration: 0.6 }}
          >
            <div className="timeline-content">
              <div className="timeline-date">{exp.period}</div>
              <div className="timeline-title">{exp.title}</div>
              <div className="timeline-company">{exp.company}</div>
              <ul>
                {exp.description.map((item, i) => (
                  <li key={i}>{item}</li>
                ))}
              </ul>
            </div>
          </motion.div>
        ))}
      </div>
    </motion.div>
  );
};

export default Experience;
